<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>ETH Price | Realtime</title>
    <!-- css -->
    <link rel="stylesheet" href="/style.e308ff8e.css">
<script src="/style.e308ff8e.js"></script></head>
<body>
    <!-- Chart Container -->
    <div class="chart-container">
        <canvas id="myChart"></canvas>
    </div>

    <!-- Stats Container -->
    <div class="stats">
        <div class="menu">
            <ul>
                <li class="active link" data="one-min">1 Minute</li>
                <li class="link" data="five-min">5 Minutes</li>
                <li class="link" data="one-month">1 Month</li>
            </ul>
        </div>
        <div class="one-min active section">
            <div class="orignal">$0</div>
            <div class="predicted">$0</div>
            <div class="indicator"></div>
        </div>
        <div class="five-min section">
            <div class="orignal"></div>
            <div class="predicted"></div>
            <div class="indicator"></div>
        </div>
        <div class="one-month section">
            <div class="orignal"></div>
            <div class="predicted"></div>
            <div class="indicator"></div>
        </div>
    </div>

    <!-- js -->
    <script src="/app.c328ef1a.js" type="module"></script>
</body>
</html>
